				angle);

		model.addPropertyChangeListener(this);
		if (!enable) {
			stop();
		}
		animator.setNewModel(model);
		oldModel.removePropertyChangeListener(this);
	}

	@Override
	public PendulumModelInterface getModel() {
		return model;
	}

	@Override
	public PendulumAnimatorCommand getAnimator() {
		return animator;
	}

	@Override
	public void stop() {
		model.stopTimer();
		enable = false;
	}

	@Override
	public void resume() {
		model.resumeTimer();
		enable = true;
	}

	@Override
	public BarPairInterface getBarPair() {
		return barPair;
	}

	@Override
	public void setBarPair(BarPairInterface newBarPair) {
		barPair = newBarPair;
	}

	@Override
	public TimerInterface getTimer() {
		return timer;
	}



}
